question = "Kan sättet en uppgift presenteras ändra hur ett barn utför det?"
answer = "Säljö visar hur barn stod absolut stilla olika länge beroende på hur aktiviteten presenterades, som lek eller tävling eller helt enkelt bara som en uppgift att stå stilla så länge de kunde."
