id = "DC261"
question = "Hur kan man ge kvalitativa analyser validitet?"
answer = "För att en kvalitativ analys ska äga vetenskaplig giltighet krävs mer än bara att beskriva det man undersökt. Det gäller att i materialet hitta en helhets olika delar och genom reflektion abstrahera sig från materialet, lyfta det och ställa det mot de teoretiska begrepp som återfinns i den teori som är vald att användas som analysredskap."
difficulty = "Hard"
category = "Education"
