[[questions]]
id = "DC280"
question = "Kan fler poliser med utländsk bakgrund öka tryggheten i marginaliserade områden?"
answer = "En ökad mångfald inom rättsväsendet anses vara centralt i arbetet mot diskriminering eftersom det förmodas öka tryggheten för målsäganden och vittnen med utländsk bakgrund i rättsprocessen, samt bidra till en ökad medvetenhet om deras förutsättningar och behov i rättsprocessen (Brå, 2008)."
