[[questions]]
id = "DC282"
question = "Vad är skillnaden mellan subjektivt och objektivt våld?"
answer = "Subjektivt våld beskrivs utgöra det synliga, direkta, explicita våldet som uttrycks i form av en konkret våldshandling som till exempel en skjutning. Objektivt våld inbegriper däremot det samhälleliga indirekta våldet som uttrycks på ett osynligt sätt, och i kontrast till det subjektiva våldet som beskrivs ha en distinkt våldsutövare och våldsoffer."
difficulty = "Medium"
category = "Social"
