question = "Vad är risken med kvalitativa intervjuer?"
answer = "Forskaren riskerar att identifiera sig med informanterna i den mån att hen inte längre kan behålla det professionella avståndet som behövs för att kunna genomföra självständiga tolkningar av den insamlade datan (Kvale & Brinkmann, 2009)."
