id = "DC289"
question = "Vilken grupp har störst chans att få hjälp av polis vid en anmälan?"
answer = "Denna tes styrks av statistik som visar att utredningar påbörjas i högre utsträckning i fall där anmälaren varit etniskt svensk (86%) i förhållande till utredningar där anmälaren haft utländsk bakgrund (62%). Förundersökningar läggs även ned i högre utsträckning i ett tidigt skede, trots befintlig utredningspotential, i ärenden där målsägande har utländsk bakgrund (Brå, 2007b)."
